import React from 'react';
import gallery from '../gallery';

function Home() {
  return (
    <main>
      <h1>Galeria</h1>
      {gallery.map(({ name, image, type }) => (
        <div>
          <p>{name}</p>
          <img src={image} alt="Imagem" />
          <p>{type}</p>
        </div>
      ))}
    </main>
  );
}

export default Home;
